CREATE TABLE `jjr_commission` (
  `comm_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '状态与佣金ID',
  `cid` int(11) NOT NULL COMMENT '客户ID',
  `tid` int(11) NOT NULL COMMENT '推荐人ID',
  `status` tinyint(1) NOT NULL COMMENT '状态：0无效客户 1新客户 2已跟进 3已到访 4已认筹 5已认购 6已签约 7已回款',
  `money` decimal(10,2) DEFAULT NULL COMMENT '推荐人佣金',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
