  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `settle_date` datetime DEFAULT NULL COMMENT '结拥时间',
  `admin_time` datetime DEFAULT NULL COMMENT '后台确认时间',
  `anchang_time` datetime DEFAULT NULL COMMENT '案场确认时间',
  `zhiye_time` datetime DEFAULT NULL COMMENT '置业顾问确认时间',
  `money_df` decimal(10,2) DEFAULT '0.00' COMMENT '带访人佣金',
  `settlement_df` enum('true','false') NOT NULL DEFAULT 'false' COMMENT '带访人是否结算佣金',
  `settle_date_df` datetime DEFAULT NULL COMMENT '带访人结算佣金时间',
  PRIMARY KEY (`comm_id`),
  KEY `i_cid` (`cid`) USING BTREE COMMENT '客户ID索引',
  KEY `i_tid` (`tid`) USING BTREE COMMENT '报备人索引'
) ENGINE=InnoDB AUTO_INCREMENT=240 DEFAULT CHARSET=utf8;
