--
-- Table structure for table `jjr_customer`
--

DROP TABLE IF EXISTS `jjr_customer`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `jjr_customer` (
  `customer_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '客户ID',
  `waid` int(11) NOT NULL COMMENT '公众帐号ID',
  `customer_uid` int(10) unsigned DEFAULT NULL COMMENT '码上代客提交客户的粉丝uid',
  `customer_name` varchar(100) NOT NULL COMMENT '客户姓名',
  `customer_phone` varchar(100) NOT NULL COMMENT '客户电话',
  `customer_other_phone` varchar(100) DEFAULT '' COMMENT '客户电话2',
  `remark` text COMMENT '备注信息',
  `customer_type` enum('NORMAL','MSDK') DEFAULT 'NORMAL' COMMENT '客户类型',
  `pid` int(11) NOT NULL COMMENT '意向楼盘',
  `tid` int(11) DEFAULT NULL COMMENT '推荐人ID',
  `zid` varchar(255) DEFAULT NULL COMMENT '置业顾问ID',
  `zphone` varchar(11) DEFAULT NULL COMMENT '置业顾问电话',
  `assign_time` datetime DEFAULT NULL COMMENT '置业顾问领取时间',
  `intent` tinyint(1) DEFAULT '0' COMMENT '意向：0无意向 1有意向',
  `price` decimal(11,2) DEFAULT NULL COMMENT '房屋成交价格（单位：元）',
  `price_time` datetime DEFAULT NULL COMMENT '房屋成交时间',
  `house_info` varchar(255) DEFAULT '' COMMENT '成交房号',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：0无效客户 1新客户 2已跟进 3已到访 4已认筹 5已认购 6已签约 7已回款 8导入客户',
  `subscribe` decimal(11,2) DEFAULT NULL COMMENT '房屋认购价格（单位：元）',
  `subscribe_time` datetime DEFAULT NULL COMMENT '房屋认购时间',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `guid` varchar(64) DEFAULT '',
  `iscall` tinyint(1) DEFAULT '0',
  `is_msc_sync` tinyint(1) DEFAULT '0',
  `recommendid` int(11) DEFAULT '0',
  `is_fang_sync` tinyint(1) DEFAULT '0',
  `is_fang_valid` tinyint(1) DEFAULT '1',
  `fang_comment` varchar(200) DEFAULT '',
  `huarun_opp_org_id` varchar(200) DEFAULT '' COMMENT '销售机会对应分期Id',
  `invalid_op_id` int(11) DEFAULT NULL COMMENT '手动干预客户，禁用操作人ID，0:后台，其他:操作人UID',
  `invalid_reason` text COMMENT '手动干预客户，禁用原因',
  `status_before_invalid` int(11) DEFAULT NULL COMMENT '设置为无效前状态',
  `invalid_time` datetime DEFAULT NULL COMMENT '无效时间',
  `ext_data` varchar(2048) DEFAULT '' COMMENT '扩展信息,属于冗余字段',
  `sync_resault` tinyint(4) DEFAULT NULL COMMENT '客户如果需要同步到第三方,这里记录是否同步成功,  1:成功 0:失败',
  `sync_to` varchar(45) DEFAULT NULL COMMENT '如果客户需要同步到第三方,这里记录同步给哪个第三方, 第三方和 customer_type 的判客值保持一直,比如 SALESFORCE 表示同步给 salesforce,同步结果在 sync_resault 字段中记录',
  `df_id` int(11) DEFAULT NULL COMMENT '代访人ID',
  `df_time` datetime DEFAULT NULL COMMENT '代访分配时间',
  `comm_plan_id` int(11) DEFAULT NULL COMMENT '佣金方案ID',
  `yuyue_time` datetime NOT NULL COMMENT '预约时间,到该时间点会给金牌经纪人消息提醒',
  `examine_type` enum('ANCHANG','XUNFANG') NOT NULL DEFAULT 'ANCHANG' COMMENT '审核人类型',
  `examine_id` int(11) NOT NULL COMMENT '审核人主键id',
  `device_type` enum('Web','Android','iOS') NOT NULL DEFAULT 'Web' COMMENT '信息来自设备类型',
  `cid` int(10) unsigned DEFAULT NULL COMMENT '机构ID',
  `store_id` int(10) unsigned DEFAULT NULL COMMENT '门店ID',
  `duid` int(10) unsigned DEFAULT NULL COMMENT '离职机构经纪人ID',
  `reassign_time` datetime DEFAULT NULL COMMENT '重新分配机构经纪人时间',
  PRIMARY KEY (`customer_id`),
  KEY `idx_invalid_op_id` (`invalid_op_id`),
  KEY `idx_status_before_invalid` (`status_before_invalid`),
  KEY `comm_plan_id` (`comm_plan_id`),
  KEY `pid` (`pid`),
  KEY `idx_yuyue_time` (`yuyue_time`),
  KEY `idx_waid` (`waid`) USING BTREE,
  KEY `idx_create_time` (`create_time`) USING BTREE,
  KEY `idx_zid` (`zid`) USING BTREE,
  KEY `idx_tid` (`tid`) USING BTREE,
  KEY `idx_cid` (`cid`),
  KEY `idx_store_id` (`store_id`),
  KEY `idx_duid` (`duid`)
) ENGINE=InnoDB AUTO_INCREMENT=155 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

